import React from 'react'
let style = {
    display : 'flex',
    justifyContent : 'center',
    padding : '10px 20px',
    textAlign : 'center',
    width : '100%'
}
function Form() {
  return (
    <div style={style}>
      <input type="text" name="frst Name" />
      <input type="text" name="2nd Name" />
      <input type="email" name="email"/>
    </div>
  )
}

export default Form
